CREATE TABLE`recipe` (
    `id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT, 
    `recipe` VARCHAR(150) NOT NULL , 
    `ingredients` TEXT NOT NULL , 
    `method` TEXT NOT NULL ,
    `cooktime` INT(20) NOT NULL,
    `imgname` varchar(200) NOT NULL,
    `image` longtext NOT NULL, 
    `added` DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP)
   ENGINE=InnoDB DEFAULT CHARSET=latin1;


INSERT INTO `recipe_tb1` (`id`, `recipe`, `ingredients`, `method`, `image`, `added`) VALUES (NULL, 'Saucy Sriracha Franks', '1 cup ketchup\r\n¼ cup soy sauce\r\n¼ cup rice vinegar\r\n3 tablespoons sriracha sauce\r\n1 tablespoon brown sugar\r\n1 teaspoon sesame oil\r\n1 teaspoon grated ginger root\r\n1 clove garlic, crushed\r\n1 (12 ounce) package all-beef franks, cut into 1-inch slices\r\n1 box toothpicks, or as needed', 'Mix ketchup, soy sauce, vinegar, sriracha, brown sugar, sesame oil, ginger, and garlic in a saucepan and bring to a simmer over low heat. Add franks and heat until warm, about 5 minutes. Serve with toothpicks.','data:image/webp;base64,', CURRENT_DATE());